#
# TABLE STRUCTURE FOR: profiles
#

DROP TABLE IF EXISTS `profiles`;

CREATE TABLE `profiles` (
  `user_id` int(10) unsigned NOT NULL,
  `birthday` date DEFAULT NULL,
  `address` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `api_key` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `secure_access` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `balance` int(10) NOT NULL DEFAULT 0,
  `trade_url` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `steam_id` int(10) NOT NULL,
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `api_key` (`api_key`),
  UNIQUE KEY `secure_access` (`secure_access`),
  UNIQUE KEY `trade_url` (`trade_url`),
  UNIQUE KEY `steam_id` (`steam_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `first_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
